import './index.scss';

var text;
const Modal = (text) => {
    return (
        <div className={ 'modal-bg' }>
            <div className={ 'modal' }>
                { text }
                <span>
                    <a onClick={ () => {
                        return true
                    } }>Okay</a>
                    <a onClick={ () => {
                        return false;
                    } }>Cancel</a>
                </span>
            </div>
        </div>
    );
}

export default function Popup(p) {
    text = p;

    return (
        <Modal />
    )
};
